import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 45.2-1808  Annual report.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/45.2-1808.md","filePath":"vacode/45.2-1808.md"}'),o={name:"vacode/45.2-1808.md"},n=t('<h1 id="§-45-2-1808-annual-report" tabindex="-1">§ 45.2-1808 Annual report. <a class="header-anchor" href="#§-45-2-1808-annual-report" aria-label="Permalink to &quot;§ 45.2-1808  Annual report.&quot;">​</a></h1><p>On or before October 15 of each year, the Authority shall submit an annual summary of its activities and recommendations to the Governor and the Chairmen of the House Committee on Appropriations, the Senate Committee on Finance and Appropriations, the House Committee on Labor and Commerce, and the Senate Committee on Commerce and Labor. Such report may include the submission of the Division required by § <a href="/vacode/45.2-1802/">45.2-1802</a>.</p><p>2010, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0507" target="_blank" rel="noreferrer">507</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0681" target="_blank" rel="noreferrer">681</a>, § 67-1209; 2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0794" target="_blank" rel="noreferrer">794</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0387" target="_blank" rel="noreferrer">387</a>.</p>',3),i=[n];function s(c,l,p,h,_,m){return a(),r("div",null,i)}const u=e(o,[["render",s]]);export{f as __pageData,u as default};
